import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';
import { TicketService } from '../../../services/ticket/ticket.service';
import { Ticket,MAJOR } from '../../../models/ticket';
import { Student } from 'src/models/student';
import { StudentService } from 'src/services/student/student.service';

const studentService = new StudentService();
@Component({
  selector: 'app-ticket-form',
  templateUrl: './ticket-form.component.html',
  styleUrls: ['./ticket-form.component.scss']
})
export class TicketFormComponent implements OnInit {

  // Note: We are using here ReactiveForms to create our form. Be careful when you look for some documentation to
  // avoid TemplateDrivenForm (another type of form)
  /**
   * TicketForm: Object which manages the form in our component.
   * More information about Reactive Forms: https://angular.io/guide/reactive-forms
   */
  public ticketForm: FormGroup;


  public MAJOR_TYPE: MAJOR[] = [MAJOR.SI,MAJOR.IF]
  public students: Student[] = studentService.getStudents()


  constructor(public formBuilder: FormBuilder, public ticketService: TicketService) {
    // Form creation
    this.ticketForm = this.formBuilder.group({
      title: [''],
      description: [''],
      major: [''],
      studentID: ['']
    });
  }

  ngOnInit() {
  }

  addTicket() {
    const ticketToCreate: Ticket = this.ticketForm.getRawValue() as Ticket;
    ticketToCreate.student = studentService.getStudents().find(student => student.id === Number(this.ticketForm.getRawValue().studentID))
    ticketToCreate.archived = false;
    this.ticketService.addTicket(ticketToCreate);
  }

}
<h3>Create a new ticket</h3>
<form class="ticket-form" [formGroup]="ticketForm">
  <label for="title">
    Title <br>
    <input class="input-custom" type="text" id="title" [formControlName]="'title'">
  </label>
  <br>
  <label for="description">
    Description <br>
    <input class="input-custom" type="text" id="description" [formControlName]="'description'">
  </label>
  <br>
  <label for="major">
    Major <br>
    <!-- display all the major option in a select -->
    <select name="major-list" id="major" [formControlName]="'major'">
      <option *ngFor="let selectedMajorType of MAJOR_TYPE" [value]="selectedMajorType">
        {{selectedMajorType}}
      </option>
    </select>
  </label>
  <br>
  <label for="student">
    student <br>
    <!-- display all the student option in a select -->
    <select formControlName="studentID">
      <option *ngFor="let student of students" [value]="student.id">{{ student.nom }} {{ student.prenom }}</option>
    </select>
  </label>
  <br>
  <button type="submit" class="btn-custom" (click)="addTicket()">Create</button>
</form>

